import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { bindActionCreators } from 'redux';
import { submitSuggest } from '../../../store/clientReducer'
import { connect } from 'react-redux';
import NumberFormat from 'react-number-format';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormControl from '@material-ui/core/FormControl';
import Checkbox from '@material-ui/core/Checkbox';
import Rating from '@material-ui/lab/Rating';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import StarBorderIcon from '@material-ui/icons/StarBorder';
import Star from '@material-ui/icons/Star';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: 'auto',
      width: '33ch',
    },
  },
  center: {
    width: '275px',
    margin: 'auto',
    paddingTop: '30px'
  },
  span: {
    marginTop: '20px',
    fontSize: "15px",
    textAlign: 'center',
    alignItems: 'center'
  },
  desejo: {
    fontSize: "12px",
  },
  desejoPai: {
    margin: 0,
    justifyContent: 'start'
  }
}));

const NumberFormatCustom = (props) => {
  const { inputRef, onChange, ...other } = props;
  return (
    <NumberFormat
      {...other}
      getInputRef={inputRef}
      onValueChange={(values) => {
        onChange({
          target: {
            name: props.name,
            value: values.value,
          },
        });
      }}
      isNumericString
      format='(##) #########'
    />
  );
}

const TextArea = () => {
  const containerStyle = {
    width: 200
  };

  const textFieldStyle = {
    marginTop: 8,
    width: "100%"
  };

  const inputStyle = {
    width: "100%"
  };

  const props = {
    style: textFieldStyle,
    label: "no explicit height",
    multiline: true,
    variant: "outlined",
    rows: 9,
    InputProps: { style: inputStyle }
  };

  return (
    <div style={containerStyle}>
      <TextField {...props} />
    </div>
  );
};

NumberFormatCustom.propTypes = {
  inputRef: PropTypes.func.isRequired,
  name: PropTypes.string.isRequired,
  onChange: PropTypes.func.isRequired,
};

const FormClient = () => {
  const classes = useStyles();
  const [checked, setChecked] = useState(false);
  const [values, setValues] = useState({
    name: '',
    phone: '',
    stars: ''
  });

  const handleChange = (event) => {
    setValues({...values, [event.target.name]: event.target.value });
    console.log(values);
  };
  const checkChange = (event) => {
    setValues({name: '', phone: ''});
    setChecked(event.target.checked);
  };

  return (
    <div className={classes.center}>
      <FormControl className={classes.root}>
        <TextField
          label="Nome"
          disabled={checked}
          value={values.name} 
          onChange={handleChange}
          name="name"
          id="standard-basic" 
        />
        <TextField
          label="Telefone"
          disabled={checked}
          value={values.phone}
          onChange={handleChange}
          name="phone"
          id="formatted-numberformat-input"
          InputProps={{inputComponent: NumberFormatCustom}}
        />
        <FormControlLabel className={classes.desejoPai}
          label={<Typography className={classes.desejo}>Desejo n√£o me identificar</Typography>}
          size="small"
          control={<Checkbox checked={values.checkedA} 
          onChange={checkChange} 
          name="checkedA" />}
        />
        <Box className={classes.span} component="fieldset" mb={3} borderColor="transparent">
          <Typography component="legend">Toque para classificar</Typography>
          <Rating
            name="stars"
            onChange={handleChange}
            defaultValue={0}
            icon={<Star fontSize="large" />}
            emptyIcon={<StarBorderIcon fontSize="large" />}
          />
        </Box>
        <TextArea />
      </FormControl>
    </div>
  );
}

FormClient.prototypes = {
  infos: PropTypes.array.isRequired
};

const mapStateToProps = state => ({
  infos: state.client.infos
});

const mapDispatchToProps = dispatch =>
  bindActionCreators({submitSuggest}, dispatch);

export default connect(mapStateToProps, mapDispatchToProps)(FormClient);
